import React from 'react'
import home11 from './home11.css';
function Home11() {
  return (
   <>
   <div className='left'>
        <img src="Image/pic1.jpg" alt="Img" />
        <div className='info'>
          <h3 className='title'>Title of vertical gallery</h3>
          <p className='para'>Travel/Augest 2017</p>
        </div>
      </div>
   </>

  )
}

export default Home11;
